var possibleStringCount = function (word, k) {
  const arr = []
  const n = word.length
  if (n < k) return 0
  let last = [word[0], 1]
  const MOD = 10 ** 9 + 7
  let mm = 1
  for (let i = 1; i < n; i++) {
    const ch = word[i]
    if (ch === last[0]) {
      last[1]++
    } else {
      if (last[1] > 1) {
        arr.push(last)
      }
      last = [ch, 1]
      mm++
    }
  }
  if (last[1] > 1) {
    arr.push(last)
  }
  const m = arr.length
  let raw = 1
  for (let i = 0; i < m; i++) {
    raw = (raw * arr[i][1]) % MOD
  }
  if (mm >= k) return raw
  const t = k - 1 - mm
  const dp = Array.from({ length: m + 1 }, () => Array(t + 1).fill(0))
  for (let j = 0; j <= t; j++) {
    dp[0][j] = 1
  }
  const s = Array.from({ length: t + 2 }, () => 0)
  for (let i = 1; i <= m; i++) {
    const c = arr[i - 1][1] - 1
    s[0] = 0
    for (let j = 0; j <= t; j++) {
      s[j + 1] = (s[j] + dp[i - 1][j]) % MOD
    }
    for (let j = 0; j <= t; j++) {
      dp[i][j] = (s[j + 1] - s[Math.max(j - c, 0)] + MOD) % MOD
    }
  }
  return (raw - dp[m][t] + MOD) % MOD
}

console.time('执行时间')
console.log(possibleStringCount('aabbccdd', 7))
